-- ----------------------------
-- Table structure for ks_mapping
-- ----------------------------
DROP TABLE IF EXISTS `ks_mapping`;
CREATE TABLE `ks_mapping` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `table_code` varchar(64) DEFAULT NULL COMMENT '所属业务表编码',
  `mapping_code` varchar(64) NOT NULL COMMENT '映射编码',
  `mapping_name` varchar(64) DEFAULT NULL COMMENT '映射名称',
  `mapping_type` tinyint(4) DEFAULT NULL COMMENT '映射类型',
  `mapping_modal` tinyint(1) DEFAULT NULL COMMENT '映射模态（0：单个实体，1：群体实体）',
  `source_mapping_code` varchar(128) DEFAULT NULL COMMENT '来源映射',
  `system_category_code` varchar(64) DEFAULT NULL COMMENT '来源知识体系编码',
  `category_full_name_cn` varchar(64) DEFAULT NULL COMMENT '类型中文全称',
  `create_user` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '创建用户id',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `modify_user` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '更新用户id',
  `modify_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `del_stat` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0：正常 1：删除',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `idx_mapping_code` (`mapping_code`)
) ENGINE=InnoDB AUTO_INCREMENT=34 DEFAULT CHARSET=utf8mb4 COMMENT='映射表';

