-- ----------------------------
-- Table structure for table_collect_info
-- ----------------------------
DROP TABLE IF EXISTS `table_collect_info`;
CREATE TABLE `table_collect_info` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `table_code` varchar(64) DEFAULT NULL COMMENT '表编码',
  `status` varchar(11) NOT NULL DEFAULT 'UNBLOCKED' COMMENT '状态：阻塞 未阻塞',
  `last_collect_time` timestamp(6) NOT NULL DEFAULT '2001-01-01 00:00:00.000000' COMMENT '上次采集时间',
  `next_collect_time` timestamp(6) NOT NULL DEFAULT '2001-01-01 00:00:00.000000' COMMENT '下次采集时间',
  `collect_interval` bigint(20) DEFAULT '10' COMMENT '采集间隔(秒)',
  `create_user` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '创建用户id',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `modify_user` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '更新用户id',
  `modify_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `del_stat` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否删除',
