DROP TABLE IF EXISTS `table_collect_log`;
CREATE TABLE `table_collect_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `table_index_code` varchar(64) DEFAULT NULL COMMENT '表索引编码',
  `table_code` varchar(64) DEFAULT NULL COMMENT '表编码',
  `start_time` timestamp(6) NULL DEFAULT NULL COMMENT '开始时间',
  `end_time` timestamp(6) NULL DEFAULT NULL COMMENT '结束时间',
