-- ----------------------------
-- Table structure for table_info
-- ----------------------------
DROP TABLE IF EXISTS `table_info`;
CREATE TABLE `table_info` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `table_code` varchar(64) DEFAULT NULL COMMENT '表编码',
  `table_name` varchar(64) DEFAULT NULL COMMENT '表名',
  `table_tags` varchar(64) DEFAULT NULL COMMENT '数据表标签',
  `entity_category_code` varchar(64) DEFAULT NULL COMMENT '实体类别编码',
  `entity_category_name` varchar(64) DEFAULT NULL COMMENT '实体类别名称',
  `description` varchar(255) DEFAULT NULL COMMENT '描述',
  `connection_key` varchar(64) DEFAULT NULL COMMENT '连接编码',
  `datasource_type` varchar(64) DEFAULT NULL COMMENT '数据源类型',
  `datasource_id` varchar(64) DEFAULT NULL COMMENT '数据源ID',
  `database_name` varchar(64) DEFAULT NULL COMMENT '数据库名称',
  `standard_table_flag` tinyint(1) NOT NULL DEFAULT '0' COMMENT '标准表标识，1:标准表 0:不合规的表',
  `create_user` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '创建用户id',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `modify_user` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '更新用户id',
  `modify_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `del_stat` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0：正常 1：删除',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `idx_table_code` (`table_code`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1607 DEFAULT CHARSET=utf8mb4 COMMENT='表基本信息';

