-- ----------------------------
-- Table structure for table_schema
-- ----------------------------
DROP TABLE IF EXISTS `table_schema`;
CREATE TABLE `table_schema` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `field_code` varchar(64) DEFAULT NULL COMMENT '字段编码',
  `table_code` varchar(64) DEFAULT NULL COMMENT '表编码',
  `field_name` varchar(64) DEFAULT NULL COMMENT '字段名称',
  `field_type` varchar(64) DEFAULT NULL COMMENT '字段类型',
  `field_modify_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '字段修改时间',
  `system_category_code` varchar(255) DEFAULT NULL COMMENT '知识体系类型编码',
  `category_full_name_cn` varchar(64) DEFAULT NULL COMMENT '类型中文全称',
  `system_property_code` varchar(255) DEFAULT NULL COMMENT '知识体系属性编码',
  `system_property_name` varchar(255) DEFAULT NULL COMMENT '知识体系属性字段名',
  `system_property_name_cn` varchar(255) DEFAULT NULL COMMENT '知识体系属性中文名',
  `mapping_code` varchar(64) DEFAULT NULL COMMENT '映射编号，用于区分实体',
  `related_mapping_code` varchar(255) DEFAULT NULL COMMENT '用于找混合表中关系关联的实体',
  `source_type` tinyint(1) DEFAULT NULL COMMENT '来源类型（0：知识体系，1：系统字段）',
  `source_table_type` varchar(11) NOT NULL COMMENT '来源表类型（entity：实体表，relation：关系表，mix：混合表）',
  `field_change` int(1) DEFAULT '-1' COMMENT '0:初始字段 1:新增字段 2:待删除字段',
  `is_primary_key` tinyint(1) NOT NULL COMMENT '是否主键 0:否 1:是',
  `is_index_field` int(11) DEFAULT '0' COMMENT '实体索引:+1;关键词索引+10;时空索引+100;混合索引+1000',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `modify_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `create_user` varchar(32) DEFAULT NULL COMMENT '创建人',
  `modify_user` varchar(32) DEFAULT NULL COMMENT '修改人',
  `del_stat` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否删除',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `idx_table_code` (`table_code`) USING BTREE,
  KEY `idx_field_code` (`field_code`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=65465 DEFAULT CHARSET=utf8mb4 COMMENT='表结构';

